void Main()
{
	var s = "";
	var k = 49385;
	Console.WriteLine(s.Length); // 60522
	Console.WriteLine(Result.findSubstring(s, k));
}

class Result
{

	/*
     * Complete the 'findSubstring' function below.
     *
     * The function is expected to return a STRING.
     * The function accepts following parameters:
     *  1. STRING s
     *  2. INTEGER k
     */

	public static string findSubstring(string s, int k)
	{
		// input = abcdefghi
		// figure out which substring of length k contains the most vowels in the input
		// if no vowels, return "Not found!"
		// otherwise output the substring

		// take a substring of (position, position + length)
		// count vowels in substring
		// compare to last substring

		if (k > s.Length) return s;
		if (k <= 0) return "";

		var longestVowelCount = 0;
		var targetSubstring = "";
		
		var previousSubstring = "";
		var previousVowelCount = 0;

		var total = TimeSpan.FromMilliseconds(0);
		var sw = new Stopwatch();
		for (var position = 0; position + k <= s.Length; position++)
		{
			var currentSubstring = s.Substring(position, k);

			sw.Restart();
			
			int currentVowelCount = 0;
			if (longestVowelCount == 0)
				currentVowelCount = countVowels(currentSubstring);
			else
			{
				var previousStringLastChar = previousSubstring[previousSubstring.Length-1];
				var currentSubstringLastChar = currentSubstring[currentSubstring.Length-1];
				
				if (previousStringLastChar == 'a'
					||previousStringLastChar == 'e'
					||previousStringLastChar == 'i'
					||previousStringLastChar == 'o'
					||previousStringLastChar == 'u') currentVowelCount = previousVowelCount - 1;

				if (currentSubstringLastChar == 'a'
					|| currentSubstringLastChar == 'e'
					|| currentSubstringLastChar == 'i'
					|| currentSubstringLastChar == 'o'
					|| currentSubstringLastChar == 'u') currentVowelCount = previousVowelCount + 1;
			}
			
			sw.Stop();
			total += sw.Elapsed;

			if (currentVowelCount > longestVowelCount)
			{
				longestVowelCount = currentVowelCount;
				targetSubstring = currentSubstring;
			}
			
			previousSubstring = currentSubstring;
			previousVowelCount = currentVowelCount;
		}

		Console.WriteLine(total);

		if (longestVowelCount == 0 || targetSubstring.Length < k) return "Not found!";

		return targetSubstring;
	}

	public static int countVowels(string s)
	{
		var vowelCount = 0;
		for(var i = 0; i < s.Length; i++)
		{
			var c = s[i];
			
			if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') vowelCount++;
		}
		return vowelCount;
	}

}